   this.authService.logout(); //This line here sets the currentUser to null everything\r\n  //   this.router.navigateByUrl(\"/welcome\")  // Routing with code with the Router module, navigateByUrl makes sure that any parameter is set to null after we log out\r\n     \r\n  // }\r\n}\r\n\n        \n    \n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/LoginComponent.html":{"url":"components/LoginComponent.html","title":"component - LoginComponent","body":"\n                   \n\n\n\n  Components\n  LoginComponent\n\n\n\n    \n        \n            Infos\n        \n        \n            Source\n        \n    \n\n    \n        \n    File\n\n\n    src/app/pages/init/login/login.component.ts\n\n\n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n\n\n            \n                providers\n                \n                    \n                        InitPresenter\n                    \n                \n            \n\n\n\n\n\n\n            \n                templateUrl\n                login.component.html\n            \n\n\n        \n    \n\n\n\n\n    \n        Constructor\n            \n                \n                    \n                        \n                            constructor(presenter: InitPresenter, fb: FormBuilder, router: Router, globalService: any)\n                        \n                    \n    \n                \n            \n    \n\n    \n        Methods\n            \n                \n                    \n                        \n                             onLogin\n                        \n                    \n    \n                    \n                        \n    onLogin()\n                        \n                    \n    \n                    \n                        \n                                \n                                    Returns:     void\n    \n                                \n              